import React from 'react'
import './Nav.css'
import {Link} from 'react-router-dom'
import Form from './Form'
const Nav=()=>{
    function click1(){
        var x=document.getElementById('form')
        if(x.style.display=='none'){
          x.style.display='block'
         
        }
           else{
          x.style.display='none'
        }
       }
    return(
        <body>
        <section className='navbar'>
            <div class='navbar1'>
                <a>HariCharan</a>
            </div>
            <div class='navbar2'>
            <a><Link to='/' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Home</Link></a>
<a><Link to='/About' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>About</Link></a>
<a><Link to='/Servive' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Servive</Link></a>

            </div>
            <div className='navbar3'>
              <button onclick={click1}>Login/Signup</button>
            </div>
        </section>
        <section className='s4'>
        <div id='form' style={{display:'none'}}>
        <Form />
        </div> 
        </section>
       </body> 
          
    );
}
export default Nav;
